import React from 'react';

class LoginMenu extends React.Component {
    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
    }

    handleClick() {
        this.props.handleAppState('CreateAccount');
    }

    render() {

        return <div className="CreateAccountBtn MenuBtn" onClick={this.handleClick}> Create Account </div>;
    }
}

export default LoginMenu;
